import React from "react"

function AddContent(){
    const Styles = {
        backgroundColor: "white",
        padding: "10px 50px 10px 50xp",
        margin: "20px auto",
        // margin: "auto",
        width: "50%",
        borderRadius: "10px",
        border: "1px solid black",
        boxShadow: "0 4px 8px 0 rgba(0,0,0,0.2)",
        transform: "translate(0px, -100px)"
    }
    return(
        <div style={Styles}>
            <h1>sdvvf</h1>
        </div>
    );
}

export default AddContent;
